import React, { Component } from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import AddGuest from "./components/add-guest.component";
import GuestMorningList from "./components/guest-list.component";

class App extends Component {
  render() {
    return (
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-dark">
          <div className="navbar-nav mr-auto">
          <li className="nav-item">
              <Link to={"/add"} className="navbar-brand">
              Check-in
              </Link>
            </li>
            <li className="nav-item">
              <Link to={"/tutorials"} className="navbar-brand">
                Visitantes
              </Link>
            </li>
          </div>
        </nav>

        <div className="container mt-3">
          <Switch>
            <Route exact path="/tutorials" component={GuestMorningList} />
            <Route exact path={["/","/add"]} component={AddGuest} />
          </Switch>
        </div>
      </div>
    );
  }
}

export default App;
